import React from 'react'
import './AutoWizard.css';

import {
    Row,
    Col
} from 'react-bootstrap';

import {
    Link
} from 'react-router-dom';

import WizardSteps from './WizardSteps';

export default function AutoWizard() {
    return (
        <Col style={{height: window.innerHeight, backgroundColor: 'yellow'}} className="d-flex flex-column" >
            
            <Row className="mx-auto" style={{backgroundColor: 'blue'}}>
                <p className="m-auto" className="wizard-title">iModo Wizard</p>
            </Row>

            <Row className="d-flex">
                <WizardSteps />
            </Row>


        </Col>
    )
}
